import React, { Component } from "react";
import { InsertData } from '../../services/InsertData';
import { get_costumes } from './get_costumes';
import { resolve } from "path";

export default class Autocomplete extends Component{

    constructor(props){
        super(props);
        this.state = {
            data:[],
            costumeData: '',
        };
       
    }

    render(){
        let result
        get_costumes(this.state).then(result);
        console.log(result);
        return(
            
            <h1>Bla</h1>
        );
    }
}
